        [Fact]
        public void CubicMeterPerDayToGasRateUnits()
        {
            GasRate cubicmeterperday = GasRate.FromCubicMetersPerDay(1);
            AssertEx.EqualTolerance(CubicFeetInOneCubicMeterPerDay, cubicmeterperday.CubicFeet, CubicFeetTolerance);
            AssertEx.EqualTolerance(CubicMetersPerDayInOneCubicMeterPerDay, cubicmeterperday.CubicMetersPerDay, CubicMetersPerDayTolerance);
            AssertEx.EqualTolerance(GigacubicFeetInOneCubicMeterPerDay, cubicmeterperday.GigacubicFeet, GigacubicFeetTolerance);
            AssertEx.EqualTolerance(HectocubicMetersPerDayInOneCubicMeterPerDay, cubicmeterperday.HectocubicMetersPerDay, HectocubicMetersPerDayTolerance);
            AssertEx.EqualTolerance(KilocubicFeetInOneCubicMeterPerDay, cubicmeterperday.KilocubicFeet, KilocubicFeetTolerance);
            AssertEx.EqualTolerance(KilocubicMetersPerDayInOneCubicMeterPerDay, cubicmeterperday.KilocubicMetersPerDay, KilocubicMetersPerDayTolerance);
            AssertEx.EqualTolerance(MegacubicFeetInOneCubicMeterPerDay, cubicmeterperday.MegacubicFeet, MegacubicFeetTolerance);
