        [Fact]
        public void ToUnit()
        {
            var cubicmeterperday = GasRate.FromCubicMetersPerDay(1);

            var cubicfootQuantity = cubicmeterperday.ToUnit(GasRateUnit.CubicFoot);
            AssertEx.EqualTolerance(CubicFeetInOneCubicMeterPerDay, (double)cubicfootQuantity.Value, CubicFeetTolerance);
            Assert.Equal(GasRateUnit.CubicFoot, cubicfootQuantity.Unit);

            var cubicmeterperdayQuantity = cubicmeterperday.ToUnit(GasRateUnit.CubicMeterPerDay);
            AssertEx.EqualTolerance(CubicMetersPerDayInOneCubicMeterPerDay, (double)cubicmeterperdayQuantity.Value, CubicMetersPerDayTolerance);
            Assert.Equal(GasRateUnit.CubicMeterPerDay, cubicmeterperdayQuantity.Unit);

            var gigacubicfootQuantity = cubicmeterperday.ToUnit(GasRateUnit.GigacubicFoot);
            AssertEx.EqualTolerance(GigacubicFeetInOneCubicMeterPerDay, (double)gigacubicfootQuantity.Value, GigacubicFeetTolerance);
            Assert.Equal(GasRateUnit.GigacubicFoot, gigacubicfootQuantity.Unit);

            var hectocubicmeterperdayQuantity = cubicmeterperday.ToUnit(GasRateUnit.HectocubicMeterPerDay);
            AssertEx.EqualTolerance(HectocubicMetersPerDayInOneCubicMeterPerDay, (double)hectocubicmeterperdayQuantity.Value, HectocubicMetersPerDayTolerance);
            Assert.Equal(GasRateUnit.HectocubicMeterPerDay, hectocubicmeterperdayQuantity.Unit);

            var kilocubicfootQuantity = cubicmeterperday.ToUnit(GasRateUnit.KilocubicFoot);
            AssertEx.EqualTolerance(KilocubicFeetInOneCubicMeterPerDay, (double)kilocubicfootQuantity.Value, KilocubicFeetTolerance);
            Assert.Equal(GasRateUnit.KilocubicFoot, kilocubicfootQuantity.Unit);

            var kilocubicmeterperdayQuantity = cubicmeterperday.ToUnit(GasRateUnit.KilocubicMeterPerDay);
            AssertEx.EqualTolerance(KilocubicMetersPerDayInOneCubicMeterPerDay, (double)kilocubicmeterperdayQuantity.Value, KilocubicMetersPerDayTolerance);
            Assert.Equal(GasRateUnit.KilocubicMeterPerDay, kilocubicmeterperdayQuantity.Unit);

            var megacubicfootQuantity = cubicmeterperday.ToUnit(GasRateUnit.MegacubicFoot);
            AssertEx.EqualTolerance(MegacubicFeetInOneCubicMeterPerDay, (double)megacubicfootQuantity.Value, MegacubicFeetTolerance);
            Assert.Equal(GasRateUnit.MegacubicFoot, megacubicfootQuantity.Unit);

            var megacubicmeterperdayQuantity = cubicmeterperday.ToUnit(GasRateUnit.MegacubicMeterPerDay);
            AssertEx.EqualTolerance(MegacubicMetersPerDayInOneCubicMeterPerDay, (double)megacubicmeterperdayQuantity.Value, MegacubicMetersPerDayTolerance);
            Assert.Equal(GasRateUnit.MegacubicMeterPerDay, megacubicmeterperdayQuantity.Unit);

            var teracubicfootQuantity = cubicmeterperday.ToUnit(GasRateUnit.TeracubicFoot);
            AssertEx.EqualTolerance(TeracubicFeetInOneCubicMeterPerDay, (double)teracubicfootQuantity.Value, TeracubicFeetTolerance);
            Assert.Equal(GasRateUnit.TeracubicFoot, teracubicfootQuantity.Unit);
        }

