            AssertEx.EqualTolerance(1, GasRate.FromKilocubicMetersPerDay(cubicmeterperday.KilocubicMetersPerDay).CubicMetersPerDay, KilocubicMetersPerDayTolerance);
            AssertEx.EqualTolerance(1, GasRate.FromMegacubicFeet(cubicmeterperday.MegacubicFeet).CubicMetersPerDay, MegacubicFeetTolerance);
            AssertEx.EqualTolerance(1, GasRate.FromMegacubicMetersPerDay(cubicmeterperday.MegacubicMetersPerDay).CubicMetersPerDay, MegacubicMetersPerDayTolerance);
