        [Fact]
        public void ArithmeticOperators()
        {
            GasRate v = GasRate.FromCubicMetersPerDay(1);
            AssertEx.EqualTolerance(-1, -v.CubicMetersPerDay, CubicMetersPerDayTolerance);
            AssertEx.EqualTolerance(2, (GasRate.FromCubicMetersPerDay(3)-v).CubicMetersPerDay, CubicMetersPerDayTolerance);
            AssertEx.EqualTolerance(2, (v + v).CubicMetersPerDay, CubicMetersPerDayTolerance);
            AssertEx.EqualTolerance(10, (v*10).CubicMetersPerDay, CubicMetersPerDayTolerance);
            AssertEx.EqualTolerance(10, (10*v).CubicMetersPerDay, CubicMetersPerDayTolerance);
            AssertEx.EqualTolerance(2, (GasRate.FromCubicMetersPerDay(10)/5).CubicMetersPerDay, CubicMetersPerDayTolerance);
            AssertEx.EqualTolerance(2, GasRate.FromCubicMetersPerDay(10)/GasRate.FromCubicMetersPerDay(5), CubicMetersPerDayTolerance);
        }

        [Fact]
        public void ComparisonOperators()
        {
            GasRate oneCubicMeterPerDay = GasRate.FromCubicMetersPerDay(1);
            GasRate twoCubicMetersPerDay = GasRate.FromCubicMetersPerDay(2);

            Assert.True(oneCubicMeterPerDay < twoCubicMetersPerDay);
            Assert.True(oneCubicMeterPerDay <= twoCubicMetersPerDay);
            Assert.True(twoCubicMetersPerDay > oneCubicMeterPerDay);
            Assert.True(twoCubicMetersPerDay >= oneCubicMeterPerDay);

            Assert.False(oneCubicMeterPerDay > twoCubicMetersPerDay);
            Assert.False(oneCubicMeterPerDay >= twoCubicMetersPerDay);
            Assert.False(twoCubicMetersPerDay < oneCubicMeterPerDay);
            Assert.False(twoCubicMetersPerDay <= oneCubicMeterPerDay);
        }

        [Fact]
        public void CompareToIsImplemented()
        {
            GasRate cubicmeterperday = GasRate.FromCubicMetersPerDay(1);
            Assert.Equal(0, cubicmeterperday.CompareTo(cubicmeterperday));
            Assert.True(cubicmeterperday.CompareTo(GasRate.Zero) > 0);
            Assert.True(GasRate.Zero.CompareTo(cubicmeterperday) < 0);
        }

